function fillTomorrowDate() {
  // 1. Calculate tomorrow's date
  const today = new Date();
  const tomorrow = new Date(today);
  tomorrow.setDate(today.getDate() + 1);

  // 2. Format to YYYY-MM-DD
  const year = tomorrow.getFullYear();
  const month = String(tomorrow.getMonth() + 1).padStart(2, '0');
  const day = String(tomorrow.getDate()).padStart(2, '0');
  const formattedDate = `${year}-${month}-${day}`;

  // 3. Find the element
  const dateInput = document.querySelector('input[name="appoint-date"]');

  if (dateInput) {
    // Set the value
    dateInput.value = formattedDate;

    // Update attributes to match the "filled" state you described
    dateInput.type = 'date';
    dateInput.setAttribute('data-last-valid-value', formattedDate);

    // 4. Dispatch events so the form knows it has been updated
    dateInput.dispatchEvent(new Event('input', { bubbles: true }));
    dateInput.dispatchEvent(new Event('change', { bubbles: true }));

    console.log("Date set to: " + formattedDate);
  } else {
    console.error("Date input field not found");
  }
}

fillTomorrowDate();
